import React from 'react'
import { useSelector } from 'react-redux'

export const Items = () => {
  const counter = useSelector(state => state.cartDropDown.cartItems.reduce((accumulator, currentValue) => {
    return accumulator + currentValue.quantity
}, 0))
  console.log('FROM USE SELECTOR: ',counter)
  return <React.Fragment>{counter}</React.Fragment>
}
